&lt;/head&gt;
&lt;body&gt;
    &lt;h1 class="F&amp;ouml;rslagsrubrik"&gt;F&amp;ouml;rslag till riksdagsbeslut&lt;/h1&gt;
    &lt;ol style="list-style-type: decimal; margin-left: 11.34mm;"&gt;
      &lt;li&gt;
        &lt;p class="Hemstl_att,F&amp;ouml;rslagspunkt,Yrkande,F&amp;ouml;rslagstext" style="margin-left: 0.0mm; text-indent: 0.0mm; word-break-inside: hyphenate;"&gt;Riksdagen tillk&amp;auml;nnager f&amp;ouml;r regeringen som sin mening vad som anf&amp;ouml;rs i motionen om problem med tidig utfasning av vissa v&amp;auml;xtskyddsmedel.&lt;/p&gt;
      &lt;/li&gt;
      &lt;li&gt;
        &lt;p class="Hemstl_att,F&amp;ouml;rslagspunkt,Yrkande,F&amp;ouml;rslagstext" style="margin-left: 0.0mm; text-indent: 0.0mm; word-break-inside: hyphenate;"&gt;Riksdagen tillk&amp;auml;nnager f&amp;ouml;r regeringen som sin mening vad som anf&amp;ouml;rs i motionen om vikten av lika villkor f&amp;ouml;r jordbruksf&amp;ouml;retagare.&lt;/p&gt;
      &lt;/li&gt;
    &lt;/ol&gt;
    &lt;h1 class="heading&amp;nbsp;1"&gt;Motivering&lt;/h1&gt;
    &lt;p class="Normal,BeslutDnr" style="word-break-inside: hyphenate;"&gt;Ett helt&amp;auml;ckande och effektivt v&amp;auml;xtskydd i tr&amp;auml;dg&amp;aring;rdsproduktion och lantbruksproduktion &amp;auml;r ett gemensamt ansvar och en viktig samh&amp;auml;llsfr&amp;aring;ga. V&amp;auml;xtskyddsmedel anv&amp;auml;nds eftersom skadeg&amp;ouml;rare och ogr&amp;auml;s angriper odlade gr&amp;ouml;dor, vilket kan utg&amp;ouml;ra ett hot mot livsmedelsf&amp;ouml;rs&amp;ouml;rjningen. Skadan de orsakar kan bli mycket omfattande. Vid all odling &amp;auml;r v&amp;auml;xtskydds&amp;aring;tg&amp;auml;rder av olika slag d&amp;auml;rf&amp;ouml;r n&amp;ouml;dv&amp;auml;ndiga. Medlen bidrar till en &amp;ouml;kad produktivitet med goda och j&amp;auml;mna sk&amp;ouml;rdar samt konkurrenskraftiga priser p&amp;aring; livsmedel, foder och annan biomassa. En god kvalitet f&amp;ouml;r m&amp;auml;nniskors och djurs h&amp;auml;lsa grundl&amp;auml;ggs genom sortval och odlingsteknik, men kan s&amp;auml;kras med v&amp;auml;xtskyddsmedel och r&amp;auml;tt lagring.&lt;/p&gt;
    &lt;p class="Normal&amp;nbsp;Indent,Normal_indrag,Normal&amp;nbsp;Indrag" style="word-break-inside: hyphenate;"&gt;Delar av den svenska odlingen kommer fram&amp;ouml;ver att sakna tillg&amp;aring;ng till ett effektivt v&amp;auml;xtskydd.&lt;/p&gt;
    &lt;p class="Normal&amp;nbsp;Indent,Normal_indrag,Normal&amp;nbsp;Indrag" style="word-break-inside: hyphenate;"&gt;Exempel p&amp;aring; detta &amp;auml;r hantering av ogr&amp;auml;s i morots-, l&amp;ouml;k- och palsternacksodling, insekter i fruktodling&lt;span style="color: #0000ff;"&gt;,&lt;/span&gt; jordloppor i v&amp;aring;roljev&amp;auml;xtodling och rapsbaggar som &amp;auml;r resistenta. Riskerna f&amp;ouml;r utveckling av resistens kommer allm&amp;auml;nt att &amp;ouml;ka d&amp;aring; antalet verkningsmekanismer endast blir ett f&amp;aring;tal eller i v&amp;auml;rsta fall en enda.&lt;/p&gt;
    &lt;p class="Normal&amp;nbsp;Indent,Normal_indrag,Normal&amp;nbsp;Indrag" style="word-break-inside: hyphenate;"&gt;Problemet &amp;auml;r bland annat att Kemikalieinspektionen (KemI) – som ansvarar f&amp;ouml;r processen kring godk&amp;auml;nnande av v&amp;auml;xtskyddsmedel i Sverige – inte l&amp;auml;ngre tar h&amp;auml;nsyn till produktionens behov av ett speciellt v&amp;auml;xtskyddsmedel. Tidigare gjordes alltid en risk- och nyttobed&amp;ouml;mning men KemI menar att EU:s regler inte l&amp;auml;ngre medger det. Andra l&amp;auml;nder g&amp;ouml;r dock en annan tolkning.&lt;/p&gt;
    &lt;p class="Normal&amp;nbsp;Indent,Normal_indrag,Normal&amp;nbsp;Indrag" style="word-break-inside: hyphenate;"&gt;Ett h&amp;ouml;gaktuellt exempel &amp;auml;r svensk odling av l&amp;ouml;k, mor&amp;ouml;tter, palsternacka och bruna b&amp;ouml;nor. D&amp;auml;r kommer anv&amp;auml;ndningen av de tv&amp;aring; viktigaste v&amp;auml;xtskyddsmedlen att f&amp;ouml;rbjudas i Sverige fr&amp;aring;n och med odlingss&amp;auml;songen 2011, medan medlen &amp;auml;r fortsatt godk&amp;auml;nda i de flesta europeiska l&amp;auml;nder, d&amp;auml;ribland Danmark och Tyskland, i ytterligare minst tv&amp;aring; &amp;aring;r.&lt;/p&gt;
    &lt;p class="Normal&amp;nbsp;Indent,Normal_indrag,Normal&amp;nbsp;Indrag" style="word-break-inside: hyphenate;"&gt;Odlarna sj&amp;auml;lva arbetar f&amp;ouml;r att hitta alternativa l&amp;ouml;sningar men trots flera &amp;aring;r av studier i f&amp;auml;ltf&amp;ouml;rs&amp;ouml;k har man inte kunnat finna vare sig nya effektiva v&amp;auml;xtskyddsmedel eller mekaniska metoder som fungerar.&lt;/p&gt;
    &lt;p class="Normal&amp;nbsp;Indent,Normal_indrag,Normal&amp;nbsp;Indrag" style="word-break-inside: hyphenate;"&gt;Risken finns nu att svenska jordbrukares konkurrenskraft minskar och d&amp;auml;rmed riskerar vi att tappa produktion inom landet. Vi riskerar dessutom att exportera milj&amp;ouml;p&amp;aring;verkan och h&amp;auml;nvisa konsumenter till att k&amp;ouml;pa importerad l&amp;ouml;k och bruna b&amp;ouml;nor som d&amp;aring; har producerats med hj&amp;auml;lp av de medel som &amp;auml;r f&amp;ouml;rbjudna i Sverige. Vilken milj&amp;ouml;nytta vi d&amp;aring; har uppn&amp;aring;tt kan f&amp;ouml;rst&amp;aring;s diskuteras.&lt;/p&gt;
    &lt;p class="Normal&amp;nbsp;Indent,Normal_indrag,Normal&amp;nbsp;Indrag" style="word-break-inside: hyphenate;"&gt;Just nu p&amp;aring;g&amp;aring;r processen inom regeringen att inf&amp;ouml;rliva direktivet om h&amp;aring;llbar anv&amp;auml;ndning av bek&amp;auml;mpningsmedel (128/2009). I det sammanhanget &amp;auml;r det viktigt att det utarbetas en &amp;ouml;vergripande konsekvensanalys f&amp;ouml;r att se vilka effekter som direktivet kan komma att f&amp;aring; f&amp;ouml;r den svenska jordbruks-, tr&amp;auml;dg&amp;aring;rds- och skogsproduktionen. Inf&amp;ouml;randet av nya regler och krav p&amp;aring;verkar ju kostnader s&amp;aring;v&amp;auml;l som allm&amp;auml;nna f&amp;ouml;retagarvillkor och ger dessutom upphov till en &amp;ouml;kad administrativ b&amp;ouml;rda. Alltf&amp;ouml;r l&amp;aring;ngtg&amp;aring;ende krav i j&amp;auml;mf&amp;ouml;relse med v&amp;aring;ra konkurrentl&amp;auml;nder riskerar att p&amp;aring;verka f&amp;ouml;retagens utveckling och m&amp;ouml;jligheter till syssels&amp;auml;ttning.&lt;/p&gt;
    &lt;table style="border-bottom-style: none; border-left-style: none; border-right-style: none; border-collapse: collapse; border-top-style: none; margin-left: -1.23mm; margin-right: auto; table-layout: fixed; width: 107.48mm;"&gt;
      &lt;colgroup&gt;&lt;col width="203"/&gt;&lt;col width="203"/&gt;&lt;/colgroup&gt;
      &lt;tbody&gt;
