&lt;p&gt;&lt;b&gt;1.	PROTOKOLLSJUSTERING&lt;/b&gt;&lt;br&gt;
	Justering av protokoll 2001/02:16 från den 12 februari 2002
&lt;p&gt;
&lt;p&gt;&lt;b&gt;2	IT OCH TELEKOMMUNIKATIONER&lt;/b&gt;&lt;br&gt;
	Behandling av motioner från de allmänna motionstiderna i &lt;br&gt;
	september 2000 och i september 2001.&lt;br&gt;
	&lt;i&gt;/föredr. Göran Nyström/&lt;/i&gt;
&lt;p&gt;
&lt;p&gt;&lt;b&gt;3	INKOMNA SKRIVELSER&lt;/b&gt;
&lt;p&gt;
&lt;p&gt;&lt;b&gt;4	INKOMNA EU-DOKUMENT&lt;/b&gt;
&lt;p&gt;
&lt;p&gt;&lt;b&gt;5	ÖVRIGA FRÅGOR&lt;/b&gt;
&lt;p&gt;
&lt;p&gt;&lt;b&gt;6	NÄSTA SAMMANTRÄDE&lt;/b&gt;
&lt;p&gt;
&lt;p&gt;
&lt;p&gt;
&lt;p&gt;&lt;b&gt;Handlingar till&lt;br&gt;
&lt;/b&gt;punkt 1. Protokoll 2001/02:16&lt;br&gt;
punkt 2 Motionshäfte och YrkandePM 2002-02-19
&lt;p&gt;
&lt;p&gt;
&lt;p&gt;
